import React from "react";

function CreateDeck({ handleCreateDeck }) {
  return (
    <button onClick={handleCreateDeck} className="button text-white bg-dark">
      <h5 className="">+</h5>
      <p className="display-4"></p>
    </button>
  );
}

export default CreateDeck;
